create schema OnlineBookingSystem;
use OnlineBookingSystem;

CREATE TABLE `bank` (
  `BankId` varchar(40) NOT NULL DEFAULT '',
  `BankName` varchar(40) DEFAULT NULL,
  PRIMARY KEY (`BankId`)
)

CREATE TABLE `city` (
  `CityCode` varchar(20) NOT NULL DEFAULT '',
  `CityName` varchar(40) DEFAULT NULL,
  PRIMARY KEY (`CityCode`)
)

CREATE TABLE `concert` (
  `ConcertId` varchar(20) DEFAULT NULL,
  `Artist` varchar(40) DEFAULT NULL,
  `Duration` time DEFAULT NULL,
  `Rating` float DEFAULT NULL,
  `Language` varchar(20) DEFAULT NULL,
  UNIQUE KEY `ConcertId` (`ConcertId`),
  CONSTRAINT `concert_ibfk_1` FOREIGN KEY (`ConcertId`) REFERENCES `show_ids_type` (`ShowId`) ON DELETE CASCADE ON UPDATE CASCADE
)

CREATE TABLE `creditcardbank` (
  `CreditCardId` varchar(50) NOT NULL DEFAULT '',
  `BanKId` varchar(40) DEFAULT NULL,
  `balance` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`CreditCardId`),
  KEY `BanKId` (`BanKId`),
  CONSTRAINT `creditcardbank_ibfk_1` FOREIGN KEY (`BanKId`) REFERENCES `bank` (`BankId`)
)

CREATE TABLE `customer` (
  `CustomerId` varchar(50) NOT NULL DEFAULT '',
  `EmailId` varchar(40) DEFAULT NULL,
  `CustomerName` varchar(40) DEFAULT NULL,
  `ContactNumber` mediumtext,
  PRIMARY KEY (`CustomerId`)
)

CREATE TABLE `drama` (
  `DramaId` varchar(20) DEFAULT NULL,
  `DramaName` varchar(40) DEFAULT NULL,
  `LeadCast` varchar(40) DEFAULT NULL,
  `Genre` varchar(20) DEFAULT NULL,
  `Duration` time DEFAULT NULL,
  `Rating` float DEFAULT NULL,
  `ReleaseDate` date DEFAULT NULL,
  `Language` varchar(20) DEFAULT NULL,
  UNIQUE KEY `DramaId` (`DramaId`),
  CONSTRAINT `drama_ibfk_1` FOREIGN KEY (`DramaId`) REFERENCES `show_ids_type` (`ShowId`) ON DELETE CASCADE ON UPDATE CASCADE
)

CREATE TABLE `guest` (
  `GuestId` varchar(50) NOT NULL DEFAULT '',
  `GuestDate` date DEFAULT NULL,
  `GuestTime` time DEFAULT NULL,
  PRIMARY KEY (`GuestId`)
)

CREATE TABLE `login` (
  `LoginId` varchar(50) NOT NULL DEFAULT '',
  `EmailId` varchar(40) DEFAULT NULL,
  `Password` varchar(40) DEFAULT NULL,
  `LoginDate` date DEFAULT NULL,
  `LoginTime` time DEFAULT NULL,
  PRIMARY KEY (`LoginId`),
  KEY `EmailId` (`EmailId`,`Password`),
  CONSTRAINT `login_ibfk_1` FOREIGN KEY (`EmailId`, `Password`) REFERENCES `user` (`EmailId`, `Password`) ON DELETE CASCADE ON UPDATE CASCADE
) 

CREATE TABLE `movie` (
  `MovieId` varchar(20) DEFAULT NULL,
  `MovieName` varchar(40) DEFAULT NULL,
  `LeadCast` varchar(40) DEFAULT NULL,
  `Genre` varchar(20) DEFAULT NULL,
  `Duration` time DEFAULT NULL,
  `Rating` float DEFAULT NULL,
  `ReleaseDate` date DEFAULT NULL,
  `Language` varchar(20) DEFAULT NULL,
  UNIQUE KEY `MovieId` (`MovieId`),
  CONSTRAINT `movie_ibfk_1` FOREIGN KEY (`MovieId`) REFERENCES `show_ids_type` (`ShowId`) ON DELETE CASCADE ON UPDATE CASCADE
)

CREATE TABLE `payment` (
  `PaymentId` int(11) NOT NULL AUTO_INCREMENT,
  `EmailId` varchar(40) DEFAULT NULL,
  `Amount` float DEFAULT NULL,
  `Date` date DEFAULT NULL,
  `Time` time DEFAULT NULL,
  `PlayId` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`PaymentId`)
)

CREATE TABLE `place_ids_type` (
  `PlaceId` varchar(40) NOT NULL DEFAULT '',
  `PlaceType` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`PlaceId`)
)

CREATE TABLE `screen` (
  `ScreenId` varchar(40) DEFAULT NULL,
  `ScreenNumber` int(11) DEFAULT NULL,
  `Capacity` int(11) DEFAULT NULL,
  `TheatreId` varchar(30) DEFAULT NULL,
  UNIQUE KEY `ScreenId` (`ScreenId`),
  KEY `TheatreId` (`TheatreId`),
  CONSTRAINT `screen_ibfk_1` FOREIGN KEY (`TheatreId`) REFERENCES `theatre` (`TheatreId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `screen_ibfk_2` FOREIGN KEY (`ScreenId`) REFERENCES `place_ids_type` (`PlaceId`) ON DELETE CASCADE ON UPDATE CASCADE
)

CREATE TABLE `seat` (
  `SeatId` varchar(50) NOT NULL DEFAULT '',
  `SeatClass` varchar(20) DEFAULT NULL,
  `PlaceId` varchar(40) DEFAULT NULL,
  PRIMARY KEY (`SeatId`),
  KEY `PlaceId` (`PlaceId`),
  CONSTRAINT `seat_ibfk_1` FOREIGN KEY (`PlaceId`) REFERENCES `place_ids_type` (`PlaceId`) ON DELETE CASCADE ON UPDATE CASCADE
)

CREATE TABLE `show_ids_type` (
  `ShowId` varchar(20) NOT NULL DEFAULT '',
  `ShowType` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`ShowId`)
)

CREATE TABLE `showplayrecord` (
  `PlayId` varchar(40) NOT NULL DEFAULT '',
  `ShowId` varchar(20) DEFAULT NULL,
  `ShowName` varchar(40) DEFAULT NULL,
  `ShowDate` date DEFAULT NULL,
  `StartTime` time DEFAULT NULL,
  `EndTime` time DEFAULT NULL,
  `PlaceId` varchar(40) DEFAULT NULL,
  PRIMARY KEY (`PlayId`),
  UNIQUE KEY `ShowId` (`ShowId`,`ShowDate`,`StartTime`,`EndTime`,`PlaceId`),
  KEY `PlaceId` (`PlaceId`),
  CONSTRAINT `showplayrecord_ibfk_1` FOREIGN KEY (`ShowId`) REFERENCES `show_ids_type` (`ShowId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `showplayrecord_ibfk_2` FOREIGN KEY (`PlaceId`) REFERENCES `place_ids_type` (`PlaceId`) ON DELETE CASCADE ON UPDATE CASCADE
)

CREATE TABLE `showseatrecord` (
  `PlayId` varchar(40) DEFAULT NULL,
  `SeatId` varchar(50) DEFAULT NULL,
  `SeatStatus` varchar(2) DEFAULT NULL,
  `Price` float DEFAULT NULL,
  UNIQUE KEY `PlayId` (`PlayId`,`SeatId`),
  KEY `SeatId` (`SeatId`),
  CONSTRAINT `showseatrecord_ibfk_1` FOREIGN KEY (`SeatId`) REFERENCES `seat` (`SeatId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `showseatrecord_ibfk_2` FOREIGN KEY (`PlayId`) REFERENCES `showplayrecord` (`PlayId`) ON DELETE CASCADE ON UPDATE CASCADE
)

CREATE TABLE `theatre` (
  `TheatreId` varchar(30) NOT NULL DEFAULT '',
  `TheatreName` varchar(40) DEFAULT NULL,
  `Screens` int(11) DEFAULT NULL,
  `CityCode` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`TheatreId`),
  KEY `CityCode` (`CityCode`),
  CONSTRAINT `theatre_ibfk_1` FOREIGN KEY (`CityCode`) REFERENCES `city` (`CityCode`) ON DELETE CASCADE ON UPDATE CASCADE
)

CREATE TABLE `ticket` (
  `TicketId` varchar(50) NOT NULL DEFAULT '',
  `PlayId` varchar(40) DEFAULT NULL,
  `SeatId` varchar(50) DEFAULT NULL,
  `CreditCardId` varchar(50) DEFAULT NULL,
  `CustomerId` varchar(50) DEFAULT NULL,
  `BookingDate` date DEFAULT NULL,
  `BookingTime` time DEFAULT NULL,
  PRIMARY KEY (`TicketId`),
  KEY `PlayId` (`PlayId`),
  KEY `SeatId` (`SeatId`),
  KEY `CustomerId` (`CustomerId`),
  KEY `CreditCardId` (`CreditCardId`),
  CONSTRAINT `ticket_ibfk_1` FOREIGN KEY (`PlayId`) REFERENCES `showplayrecord` (`PlayId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `ticket_ibfk_2` FOREIGN KEY (`SeatId`) REFERENCES `showseatrecord` (`SeatId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `ticket_ibfk_3` FOREIGN KEY (`CustomerId`) REFERENCES `customer` (`CustomerId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `ticket_ibfk_4` FOREIGN KEY (`CreditCardId`) REFERENCES `creditcardbank` (`CreditCardId`),
  CONSTRAINT `ticket_ibfk_5` FOREIGN KEY (`CreditCardId`) REFERENCES `creditcardbank` (`CreditCardId`) ON DELETE CASCADE ON UPDATE CASCADE
)

CREATE TABLE `user` (
  `EmailId` varchar(40) NOT NULL DEFAULT '',
  `Name` varchar(40) DEFAULT NULL,
  `Password` varchar(40) DEFAULT NULL,
  `ContactNumber` mediumtext,
  `Birthday` date DEFAULT NULL,
  PRIMARY KEY (`EmailId`),
  UNIQUE KEY `EmailId` (`EmailId`,`Password`)
)

CREATE TABLE `usershowrating` (
  `ShowId` varchar(20) DEFAULT NULL,
  `EmailId` varchar(40) DEFAULT NULL,
  `rating` float DEFAULT NULL,
  UNIQUE KEY `ShowId` (`ShowId`,`EmailId`),
  KEY `EmailId` (`EmailId`),
  CONSTRAINT `usershowrating_ibfk_1` FOREIGN KEY (`ShowId`) REFERENCES `show_ids_type` (`ShowId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `usershowrating_ibfk_2` FOREIGN KEY (`EmailId`) REFERENCES `user` (`EmailId`) ON DELETE CASCADE ON UPDATE CASCADE
)

CREATE TABLE `venue` (
  `VenueId` varchar(40) DEFAULT NULL,
  `VenueName` varchar(40) DEFAULT NULL,
  `Capacity` int(11) DEFAULT NULL,
  `CityCode` varchar(20) DEFAULT NULL,
  UNIQUE KEY `VenueId` (`VenueId`),
  KEY `CityCode` (`CityCode`),
  CONSTRAINT `venue_ibfk_1` FOREIGN KEY (`VenueId`) REFERENCES `place_ids_type` (`PlaceId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `venue_ibfk_2` FOREIGN KEY (`CityCode`) REFERENCES `city` (`CityCode`) ON DELETE CASCADE ON UPDATE CASCADE
)

