select * from user;

select name,PlayID,Amount from User, Payment where User.EmailID = Payment.EmailID;

select * from Guest ORDER BY GuestID;

select Name,LoginDate,LoginTime from User,Login where User.ID = Login.LoginID;

select name,MovieName,Movie.Rating from User JOIN Movie Join UserShowRating ON User.EmailID = UserShowRating.EmailID AND UserShowRating.ShowID = Movie.ShowID; 

select ConcertID from Concert JOIN Show_ids_type ON Concert.ShowID = Show_ids_type.ShowID where Rating > 3 
UNION 
select ConcertID from Concert JOIN Show_ids_type ON Concert.ShowID = Show_ids_type.ShowID where language = 'English';

select ShowID from Drama
EXCEPT
select DISTINCT ShowID from Concert;

select SeatClass,SeatStatus,PlayID from ShowSeatRecords Natural JOIN Seat Natural JOIN Ticket;

select Balance,BankName from Bank Natural JOIN CreditCardBank; 

select CustomerName,CustomerID PlayID,SeatID from Customer JOIN Ticket ON Customer.TicketID = Ticket.TicketID;

select CityName,PlaceID,TheatreName from City JOIN (select CityCode from Theatre Natural JOIN Screen) where City.CityCode = Theatre.CityCode;

select ShowName,ShowDate,StartTime,EndTime from ShowPlayRecords ORDER BY StartTime;

select * from Show_ids_type;

select Name, Rating, ShowType from User JOIN (select EmailID from UserShowRating JOIN Show_ids_type ON UserShowRating.ShowID = Show_ids_type)AS p  where User.EmailID = p.EmailID;

select * from Guest;

select LoginDate,LoginTime,ContactNumber from User Left JOIN Login on User.EmailID = Login.EmailID;

select ConcertID from Concert natural JOIN Show_ids_type
UNION
select DramaID from Drama natural JOIN Show_ids_type
UNION
select MovieID from Concert Movie JOIN Show_ids_type;



